import React, { Component } from "react";
import {
    Container, Row, Col
} from 'react-bootstrap';
import Form from "./Form";
// init("user_1I17qEirtZkLAh5ed5qOv");
// init("template_2qz531s");
// serviceID("service_olw30ew");

class Demo extends Component {


    render() {


        return (
            <div className="component_content demo">
                <Container>
                    <Row>
                        <Col xs={12} xl={6}>

                            <Form/>

                        </Col>
                        <Col xs={12} xl={6}>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Demo;
